    var nameString = ' ' + food.name
    console.log(nameString.length)
    var dotss = [' ']
        for(var i = 0 ; i < 135 - nameString.length ; i ++){
            dotss.push('   .   ')
        }
    
    return(
        <div>
            <div className = "food">
            <h3>
                {food.name}
                {dotss}
                {food.price  + " RON"}
            </h3>
            <h3>
                {food.description}
            </h3>
            <button class="btn btn-add" type="submit" onClick={(e,food) => onClick(e,food)}>Add</button>
        </div>
        
        </div>
        
        
    )
}

